import './App.css';
import styled from "styled-components"; 

const Container = styled.div`
  display: flex; 
  flex-direction: row; 
  height: 100vh;
  width: 100%; 
  background: #f8f9fb;
`

function App() {
  return <Container>Anna Kaplan</Container>
}

export default App;
